function init_iconsax(){document.querySelectorAll(".iconsax").forEach(t=>{var e=t.getAttribute("data-icon").toLowerCase().trim();fetch("https://glenthemes.github.io/iconsax/icons/"+e+".svg").then(t=>t.text()).then(e=>{t.innerHTML=e,t.querySelectorAll("[http-equiv='Content-Security-Policy']").length&&(t.innerHTML="")})})}document.addEventListener("DOMContentLoaded",()=>{init_iconsax()});